import React, { useState } from 'react';
import { Link, useLocation } from 'react-router-dom';

const Sidebar = ({ isCollapsed, toggleSidebar }) => {
  const [isDarkMode, setIsDarkMode] = useState(true);
  const [modesOpen, setModesOpen] = useState(false);
  const [payloadsOpen, setPayloadsOpen] = useState(false);
  const location = useLocation();

  const toggleTheme = () => {
    setIsDarkMode(!isDarkMode);
    document.body.classList.toggle('light-mode');
  };

  const isActive = (path) => location.pathname === path;

  return (
    <aside id="sidebar" className={`w-60 bg-gray-800 shadow-lg flex flex-col transition-all duration-300 ease-in-out ${isCollapsed ? 'collapsed' : ''}`} data-sidebar="main">
      <div className="p-4 flex items-center justify-center h-18 border-b border-gray-700">
        <img id="sidebar-logo" src="/images/Logo.png" alt="CyberLynx Logo" className="h-10 w-10 object-contain rounded-lg mr-3" />
        <h1 id="sidebar-title" className={`text-2xl font-bold text-green-400 ${isCollapsed ? 'hidden' : ''}`}>CyberLynX</h1>
      </div>
      <button id="add-target-btn" className={`w-11/12 mx-auto mt-4 py-2 px-4 bg-purple-600 hover:bg-purple-700 rounded-full text-white font-semibold shadow-md transition-colors duration-200 ${isCollapsed ? 'hidden' : ''}`}>
        Add Target
      </button>
      <nav className="mt-6 flex-grow">
        <ul className="space-y-2">
          <li>
            <Link to="/" className={`flex items-center py-2 px-4 ${isActive('/') ? 'text-white bg-purple-600 rounded' : 'text-gray-300 hover:bg-gray-700 hover:text-white'} transition-colors duration-200`} data-tooltip="Dashboard">
              <svg className="w-5 h-5 mr-3" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M3 12l2-2m0 0l7-7 7 7M5 10v10a1 1 0 001 1h3m10-11l2 2m-2-2v10a1 1 0 01-1 1h-3m-6 0a1 1 0 001-1v-4a1 1 0 011-1h2a1 1 0 011 1v4a1 1 0 001 1m-6 0h6"></path></svg>
              <span className={`nav-text ${isCollapsed ? 'hidden' : ''}`}>Dashboard</span>
            </Link>
          </li>
          {/* Add other links here */}
        </ul>
      </nav>
      <div className="p-4 border-t border-gray-700">
        <button onClick={toggleTheme} id="theme-toggle" className="w-full py-2 px-4 bg-gray-700 hover:bg-gray-600 rounded-md text-white flex items-center justify-center transition-colors duration-200">
          <svg id="theme-icon" className="w-5 h-5 mr-2" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg">
            {isDarkMode ? <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M20.354 15.354A9 9 0 018.646 3.646 9.003 9.003 0 0012 21a9.003 9.003 0 008.354-5.646z"></path> : <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M12 3v1m0 16v1m9-9h-1M4 12H3m15.364 6.364l-.707-.707M6.343 6.343l-.707-.707m12.728 0l-.707.707M6.343 17.657l-.707.707M16 12a4 4 0 11-8 0 4 4 0 018 0z"></path>}
          </svg>
          <span id="theme-text" className={isCollapsed ? 'hidden' : ''}>{isDarkMode ? 'Light Mode' : 'Dark Mode'}</span>
        </button>
        <button onClick={toggleSidebar} id="sidebar-toggle" className="w-full mt-2 py-2 px-4 bg-gray-700 hover:bg-gray-600 rounded-md text-white flex items-center justify-center transition-colors duration-200">
          <svg id="sidebar-icon" className={`w-5 h-5 mr-2 transform ${isCollapsed ? '' : 'rotate-180'}`} fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M11 19l-7-7 7-7m8 14l-7-7 7-7"></path></svg>
          <span id="sidebar-text" className={isCollapsed ? 'hidden' : ''}>{isCollapsed ? 'Expand' : 'Collapse'}</span>
        </button>
      </div>
    </aside>
  );
};

export default Sidebar;
